import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const rob = `
const rob = (nums = []) => {
  const memo = {}
  const aux = (index = 0) => {
    if (memo[index] !== undefined) {
      return memo[index]
    }
    if (index >= nums.length) {
      return 0
    }
    memo[index] = Math.max(
      aux(index + 2) + nums[index],
      aux(index + 1),
    )
    return memo[index]
  }
  return aux()
}


console.log(rob([2,7,9,3,1]))`.trim();

const countPrimes = `
const countPrimes = (n) => {
  const map = []
  for (let i = 2; i < n; i++) {
    map[i] = true
  }
  for (let i = 2; i * i < n; i++) {
    if (map[i]) {
      for (let j = i * i; j < n; j += i) {
        map[j] = false
      }
    }
  }
  return map.filter(num => num === true).length
}

console.log(countPrimes(10))`.trim();

const isIsomorphic = `
const isIsomorphic = (s, t = '') => {
  const count = str => Array.prototype.reduce.call(str, (map, c, index) => {
    if (map[c]) {
      map[c].push(index)
    }
    map[c] = [index]
    return map
  }, {})
  const mapS = count(s)
  const mapT = count(t)

  for (let i = 0; i < s.length; i++) {
    const charS = s[i]
    const charT = t[i]
    for (let j = 0; j < mapS[charS].length; j++) {
      if (mapS[charS][j] !== mapT[charT][j]) {
        return false
      }
    }
  }
  return true
}


console.log(isIsomorphic("egg", "add"))`.trim();

const countElements = `
var countElements = function(arr) {
  const set = new Set()

  arr.forEach(num => set.add(num))
  return arr.reduce((acc, num) => {
      if(set.has(num+1)){
          return acc + 1
      }
      return acc
  },0)
};

console.log(countElements([1,2,3,0]))`.trim();

const find132pattern = `
const find132pattern = function (nums) {
  let max = -Infinity
  const stack = []
  for (let i = nums.length - 1; i >= 0; i--) {
    while (nums[i] > stack[stack.length - 1]) {
      max = stack.pop()
    }
    if (nums[i] < max) {
      return true
    }
    stack.push(nums[i])
  }
  return false
}

console.log(find132pattern([3,1,4,2]))`.trim();

const numIdenticalPairs = `
const numIdenticalPairs = function (nums) {
  let count = 0
  for (let i = 0; i < nums.length; i++) {
    for (let j = i + 1; j < nums.length; j++) {
      if (nums[i] === nums[j]) {
        count += 1
      }
    }
  }
  return count
}

console.log(numIdenticalPairs([1,2,3,1,1,3]))`.trim();

const graph = ``.trim();

