              <h3>5. 132 Pattern.</h3>
              Input: nums = [1,2,3,4]<br/>
Output: false<br/>
Explanation: There is no 132 pattern in the sequence.
              <div style={titles}>
                <PrismCode
                  code={find132pattern}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>6. Number of Good Pairs.</h3>
              Input: nums = [1,2,3,1,1,3] <br/>
Output: 4 <br/>
Explanation: There are 4 good pairs (0,3), (0,4), (3,4), (2,5) 0-indexed.
              <div style={titles}>
                <PrismCode
                  code={numIdenticalPairs}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>7. </h3>

              <div style={titles}>
                <PrismCode
                  code={graph}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={graph}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={graph}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={graph}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    )
  }
